import React from 'react';
import  PropTypes from 'prop-types';
import './Navbar.css';

function Navbar(props) {
    const {active} = props;

    const [isActive, setIsActive] = useState(false);

  const toggleActive = () => {
    setIsActive(!isActive);
  };


  return (
    <nav className={`navbar ${active ? 'active':''}`}>
      <div className="navbar-container">
        <div className="navbar-burger">
          <i className="fas fa-bars"></i>
          <div className="logo">
        {/* Insert your logo here */}
      </div>
      <button className={`burger-button ${isActive ? "active" : ""}`} onClick={toggleActive}>
        <span className="burger-icon"></span>
      </button>
      <ul className={`nav-links ${isActive ? "active" : ""}`}>
        {/* Insert your navigation links here */}
      </ul>

        </div>
        <div className="navbar-location">
          <i className="fas fa-map-marker-alt"></i>
          <span>Location</span>
        </div>
        <div className="navbar-search">
          <input type="text" placeholder="Search" />
          <i className="fas fa-search"></i>
        </div>
        <div className="navbar-cart">
          <i className="fas fa-shopping-cart"></i>
        </div>
        <div className="navbar-signin">
          <button>Sign In</button>
        </div>
        <div className="navbar-categories">
          <button>Groceries</button>
          <button>Premium Fruits</button>
          <button>Home & Kitchen</button>
          <button>Fashion</button>
          <button>Electronics</button>
          <button>Beauty</button>
          <button>Jewellery</button>
          <button>Home Improvements</button>
          <button>Sport</button>
          <button>Toyes & Luggage</button>
        </div>
      </div>
    </nav>
  );
}

Navbar.propTypes = {
    active: PropTypes.bool,
}.isRequired;

export default Navbar;
